import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { v4 as uuidv4 } from "uuid"; // uuid import
import "./style.css";

const CreateGroupPage = ({ addGroup }) => {
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");
  const [image, setImage] = useState("");
  const [isPrivate, setIsPrivate] = useState(false);
  const [password, setPassword] = useState("");
  const [isSuccess, setIsSuccess] = useState(null); // State to track success or failure
  const navigate = useNavigate();

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      setImage(URL.createObjectURL(file)); // Save the selected file URL in the state
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const newGroup = {
      id: uuidv4(), // Assign a unique id to the new group
      title,
      description,
      image,
      isPrivate,
      password,
      createdAt: new Date(), // Add group creation time
      likes: 0, // Set likes to 0 by default
      memories: [],
      memoriesCount: 0,
      recommendations: 0,
    };

    try {
      addGroup(newGroup); // Attempt to add the group
      setIsSuccess(true); // Set success to true if adding the group was successful
    } catch (error) {
      setIsSuccess(false); // Set success to false if there was an error
    }
  };

  return (
    <div className="create-group-container">
      {isSuccess === null && <h1 className="title">그룹 만들기</h1>}
      {isSuccess === null ? (
        <form onSubmit={handleSubmit} className="create-group-form">
          <div className="form-group">
            <label>그룹명</label>
            <input
              type="text"
              placeholder="그룹명을 입력해 주세요"
              value={title}
              onChange={(e) => setTitle(e.target.value)}
            />
          </div>
          <div className="form-group">
            <label>대표 이미지</label>
            <div className="file-input-container">
              <input
                type="file"
                accept="image/*"
                onChange={handleFileChange} // Call handleFileChange when a file is selected
                className="file-input"
              />
            </div>
          </div>
          <div className="form-group">
            <label>그룹 소개</label>
            <textarea
              placeholder="그룹을 소개해 주세요"
              value={description}
              onChange={(e) => setDescription(e.target.value)}
            />
          </div>
          <div className="form-group">
            <label>그룹 공개 선택</label>
            <div className="toggle-container">
              <label className="toggle-label">
                공개
                <input
                  type="checkbox"
                  checked={!isPrivate}
                  onChange={(e) => setIsPrivate(!e.target.checked)}
                  className="toggle-input"
                />
                <span className="toggle-slider"></span>
              </label>
            </div>
          </div>
          {isPrivate && (
            <div className="form-group">
              <label>비밀번호</label>
              <input
                type="password"
                placeholder="비밀번호를 입력해 주세요"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
            </div>
          )}
          <button type="submit" className="submit-button">
            만들기
          </button>
        </form>
      ) : isSuccess ? (
        <div className="message success">
          <p>그룹 만들기 성공</p>
          <p>그룹이 성공적으로 등록되었습니다.</p>
          <button onClick={() => navigate("/")}>확인</button>
        </div>
      ) : (
        <div className="message failure">
          <p>그룹 만들기 실패</p>
          <p>그룹 등록에 실패했습니다.</p>
          <button onClick={() => setIsSuccess(null)}>확인</button>
        </div>
      )}
    </div>
  );
};

export default CreateGroupPage;
